    let hour = updated.getHours;
    return (
        <div className={classes.report}>
            <div className={classes.top}>
                <p>{correntReport.name}</p>
    <p>{month} {day}</p>
            </div>
            <div className={classes.bottom}>
                <p>{props.report.type} {props.report.location}</p>
